import React, { Component } from 'react';
import './App.css';


const ogPokemon = {
  fire: [
    { id: 1, name: 'Charmander', size: 'small' },
    { id: 1, name: 'Charmeleon', size: 'medium' },
    { id: 1, name: 'Charizard', size: 'large' }
  ],

  grass: [
    { id: 1, name: 'Squirtle', size: 'small' },
    { id: 1, name: 'Wartortle', size: 'medium' },
    { id: 1, name: 'Blastoise', size: 'large' }
  ],

  water: [
    { id: 1, name: 'Bulbasaur', size: 'small' },
    { id: 1, name: 'Ivysaur', size: 'medium' },
    { id: 1, name: 'Venusaur', size: 'large' }
  ]
}


class App extends Component {
  render() {
    return (
      <div>
        <h1>Original Pokemon</h1>
        <h3>Fire Type</h3>
        <ul>
          <li>Charmander</li>
          <li>Charmeleon</li>
          <li>Charizard</li>
        </ul>
        <hr/>
        <h3>Water Type</h3>
        <ul>
          <li>Squirtle</li>
          <li>Wartortle</li>
          <li>Blastoise</li>
        </ul>
        <hr/>
        <h3>Grass Type</h3>
        <ul>
          <li>Bulbasaur</li>
          <li>Ivysaur</li>
          <li>Venusaur</li>
        </ul>
        <hr/>
      </div>
    );
  }
}

export default App;
